import os
import re
import os.path as osp

from urllib.request import urlopen

def download_model(model_url, ckpt_dir):
    model_path = re.split('/',model_url)[-1]
    results_path = osp.join(ckpt_dir, re.split('.pth',model_path)[0]+'.csv')
    results_url = re.split(model_path,model_url)[0]+'training_results.csv'
    model_path = osp.join(ckpt_dir, model_path)
    if not os.path.isfile(model_path):
        filedata = urlopen(model_url.replace('=','%3D'))
        datatowrite = filedata.read()
        with open(model_path, 'wb') as f:
            f.write(datatowrite)
            
    if not os.path.isfile(results_path):
        filedata = urlopen(results_url)
        datatowrite = filedata.read()
        with open(results_path, 'wb') as f:
            f.write(datatowrite)
            
    return model_path, results_path

